import React from "react";
import MainPage from "./pages/MainPage";
import LinkLayout from "./layouts/LinkLayout";
import CollectionsPage from "./pages/CollectionsPage";
import AboutUsPage from "./pages/AboutUsPage";
import ContactPage from "./pages/ContactPage";
import OffersPage from "./pages/OffersPage";
import MadeByUPage from "./pages/MadeByUPage";
import BagDetail from "./components/BagDetail";
import RegisteredSuccessfuly from "./components/registeredSuccessfuly";
import SearchPage from "./pages/SearchPage";


const router = [
   
    {
        element: <LinkLayout/>,
        path: '/',
        children: [
            {
                element: <MainPage/>,
                index: true
            },
            {
                element: <MainPage/>,
                path:'/main',
            },
            {
                element: <CollectionsPage/>,
                path: '/collections'
            },
            {
                element:<AboutUsPage/>,
                path:'/aboutus'
            },
            {
                element:<ContactPage/>,
                path:'/contact'
            },
            {
                element:<OffersPage/>,
                path:'/collections/offers'
            },
            {
                element:<MadeByUPage/>,
                path:'/madebyu'
            },
            {
                element: <BagDetail />,
                path: 'collections/bagdetail/:id'
            },
            {
                element: <RegisteredSuccessfuly />,
                path: '/registered'
            }
            ,
            {
                element:<SearchPage />,
                path:'/search'
            },
        ]
    }
]

export default router
